import React, {Component} from 'react';

class Category extends Component {
    render() {
        return (
            <div>
                <ul>
                    <li><a href="">Lorem ipsum.</a></li>
                    <li><a href="">Dolorem, explicabo!</a></li>
                    <li><a href="">Ipsam, odio!</a></li>
                    <li><a href="">Incidunt, voluptatibus.</a></li>
                    <li><a href="">Amet, corporis.</a></li>
                    <li><a href="">Quaerat, vitae!</a></li>
                    <li><a href="">Laudantium, minima.</a></li>
                    <li><a href="">Eligendi, pariatur.</a></li>
                    <li><a href="">Consectetur, optio.</a></li>
                    <li><a href="">Possimus, velit.</a></li>
                </ul>
            </div>
        );
    }
}

export default Category;
